import React from 'react';
import './CircleSelector.css';

const CircleSelectors = (props) => (


  <div className='CircleSelector'>


<button
id="1" 
onClick={e => props.selectCircle(e.target.id)}
className={`${props.currentCircle ? 'nope' : 'selected'}` }
>
    SELECT CIRCLE 1
</button>
<button id="2" onClick={e => props.selectCircle(e.target.id)}>SELECT CIRCLE 2</button>
<button id="3" onClick={e => props.selectCircle(e.target.id)}>SELECT CIRCLE 3</button>
<button id="4" onClick={e => props.selectCircle(e.target.id)}>SELECT CIRCLE 4</button>

  </div>
);

export default CircleSelectors;
